import React, { Component } from "react";
import styled from "styled-components";
import { Button } from "../index";

class Tab extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  componentDidMount() {
    console.log(this.props.number);
    console.log(this.props.title);
  }

  render() {
    return (
      <>
        <div
          style={{
            display: "flex",
            flexDirection: "row",
            flex: 1,
            width: "100%",
            height: "100%",
            maxWidth: "325px",
            maxHeight: "140px",
            padding: "32px",
            borderRadius: "10px",
            boxShadow: "5px 5px 15px rgba(0, 0, 0, 0.15)",
            justifyContent: "space-evenly",
            alignItems: "center",
            marginBottom: this.props.number == 1 ? "150px" : "0px",
          }}
        >
          <div style={{ display: "flex", flex: 0.3 }}>
            <img src={this.props.img} />
          </div>
          <div style={{ display: "flex", flex: 0.7 }}>{this.props.message}</div>
        </div>
      </>
    );
  }
}

export default Tab;
